"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.newsByGame=void 0;const e={730:{gid:"4074045244007393762",title:"Ninjas in Pyjamas sign dev1ce on a three-year CS:GO contract",url:"https://steamstore-a.akamaihd.net/news/externalpost/The Loadout/4074045244007393762",is_external_url:!0,author:"editor@theloadout.com",contents:'<img width="900" height="507" src="https://www.theloadout.com/wp-content/uploads/2020/01/device-astralis-starladder-berlin-major-csgo-1920-1080-the-loadout-900x506.jpeg"/><p>Four-time Counter-Strike: Global Offensive Major winner Nicolai \'dev1ce\' Reedtz has today announced he\'s closed the door on his time with Astralis, an organisation he helped set up in January 2016. The 25-year-old Dane now joins Ninjas in Pyjamas by "personal request" on a three-year deal.</p>\n<p>His transfer comes after Astralis struggled to halt its decline in 2021, with dev1ce himself hinting at roster changes in an interview with <a href="https://www.hltv.org/news/31546/device-it-is-to-be-expected-that-some-things-might-change">HLTV</a> two weeks ago. This now marks the first time in eight years that the AWPer will play without Peter \'dupreeh\' Rasmussen and Andreas \'Xyp9x\' Højsleth.</p>\n<p>"Leaving Astralis is tough, to say the least," dev1ce says in a press release. "The boys will always be like family to me, but this COVID era has left me thinking a lot; where do I see myself when it all goes back to normal? I\'ve lived in Sweden for some time now, speaking the language and I\'m really hyped about this young and exciting NIP project. To join one of the most successful organizations, where so many legends have played, inspires me."</p>\n<p><a href="https://www.theloadout.com/csgo/nip-astralis-dev1ce">Read the rest of the story...</a></p>\n<p>RELATED LINKS:<br />\n<a href="https://www.theloadout.com/csgo/patch-notes">CS:GO patch notes: what\'s new in the latest update?</a><br />\n<a href="https://www.theloadout.com/csgo/virtus-pro-2016-terrorist-group-mistake">Virtus.pro mistaken for terrorist group after 2016 CS:GO prize money blunder</a><br />\n<a href="https://www.theloadout.com/csgo/vac-ban-review">Valve reviews its CS:GO VAC ban policy, frees some professionals</a></p>',feedlabel:"The Loadout",date:1619181199,feedname:"The Loadout",feed_type:0,appid:730},570:{gid:"4074045244003679473",title:"A Dota 2 fan is recreating its runes as gorgeous animations",url:"https://steamstore-a.akamaihd.net/news/externalpost/PCGamesN/4074045244003679473",is_external_url:!0,author:"editor@pcgamesn.com",contents:'<img width="900" height="507" src="https://www.pcgamesn.com/wp-content/uploads/2020/09/dota-2-windranger-arcana-900x506.jpg"/><p>Runes are a familiar - and very handy - feature of Dota 2, popping up on the <a href="https://www.pcgamesn.com/which-best-moba">MOBA game\'s</a> map to offer temporary buffs and effects, or even to drop some extra gold into your hero\'s pocket. They\'ve also got some appealing designs, signalling what each is used for - and now, one fan\'s taken this a whole leap further by recreating the runes as gorgeous animated art.</p>\n<p>Dota 2 fan SurWesley has been busy recreating a bunch of the <a href="https://www.pcgamesn.com/best-multiplayer-games">multiplayer game\'s</a> runes using the open-source 3D graphics software Blender and sharing them on Reddit lately, with several already completed - and they\'re really lovely things to look at. One that\'s particularly caught my eye is their animated recreation of Dota\'s regeneration rune.</p>\n<p>Its wedge-like chunk of translucent and vivid green glassy material looks just how you\'d imagine it from the in-game model, and we can see its branches and leaves crunch as they wrap around it. It even incorporates that distinctive <a href="https://dota2.fandom.com/wiki/Item_sounds">sound effect</a> Dota fans will know well, so we\'re in no doubt what it is - you can take a look below for yourself.</p>\n<p><a href="https://www.pcgamesn.com/dota-2/rune-animations">Read the rest of the story...</a></p>\n<p>RELATED LINKS:<br />\n<a href="https://www.pcgamesn.com/dota-2/dragons-blood-season-2">Dota: Dragon\'s Blood Season 2 is officially in the works</a><br />\n<a href="https://www.pcgamesn.com/dota-2/netflix-documentary">Dota 2 documentary coming to Netflix</a><br />\n<a href="https://www.pcgamesn.com/dota-2/steam-workshop-summer-2021">Dota 2 devs put out summer 2021 Steam Workshop call to arms</a></p>',feedlabel:"PCGamesN",date:1619092914,feedname:"PCGamesN",feed_type:0,appid:570},1091500:{gid:"4074045244007442610",title:"CD Projekt made over £215m profit in 2020 - despite Cyberpunk 2077 refunds costing tens of millions",url:"https://steamstore-a.akamaihd.net/news/externalpost/eurogamer/4074045244007442610",is_external_url:!0,author:"",contents:'<img src="https://d2skuhm0vrry40.cloudfront.net/2021/articles/2021-04-23-11-46/cd-projekt-made-over-gbp215m-profit-in-2020-despite-cyberpunk-2077-refunds-costing-tens-of-millions-1619174781416.jpg/EG11/resize/300x-1/quality/90/format/jpg" alt=""/><p>Refunds of Cyberpunk 2077 failed to dent CD Projekt\'s sales success.</p><p>In its <a href="https://www.cdprojekt.com/en/wp-content/uploads-en/2021/04/separate-financial-statement-of-cd-projekt-sa-for-2020.pdf" target="_blank">financial report</a> for last year, CD Projekt revealed 30,000 refunds were issued through its "Help Me Refund" program. The company spent 8.46m PLN (£1.6m) on the program.</p><p>However, it\'s worth pointing out that the 30,000 refunds figure relates only to CD Projekt\'s own "Help Me Refund" program. It does not include refunds made by other shops and digital storefronts.</p><p><a href="https://www.eurogamer.net/articles/2021-04-23-cd-projekt-made-over-gbp215m-profit-in-2020-despite-cyberpunk-2077-refunds-costing-tens-of-millions">Read more</a></p>',feedlabel:"Eurogamer",date:1619182140,feedname:"eurogamer",feed_type:0,appid:292030}};exports.newsByGame=e;
